import React from 'react';
import {Navbar,Nav, NavDropdown} from 'react-bootstrap';
import {Link} from 'react-router-dom';
import AuthenticationService from '../../../auth/services/AuthenticationService';

class Sidebar extends React.Component{
    handleLogout = () => {
        AuthenticationService.logout().then(() => {
          //una vez eliminado el session storage hacemos un redirect al login
        //   this.props.history.push('/');
          window.location = '/login';
        });
      };
    render(){
        
        return(
            <div>
            <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
            <Navbar.Brand href="/">Walle</Navbar.Brand>
            <Navbar.Toggle aria-controls="responsive-navbar-nav" />
            <Navbar.Collapse id="responsive-navbar-nav">
                <Nav className="mr-auto">
                <Nav.Link>
                    <Link className='navbar-brand' to="/users">
                        Usuarios
                    </Link>
                </Nav.Link>
                <Nav.Link >
                    <Link className='navbar-brand' to="/catalog">
                        Remitos
                    </Link>
                </Nav.Link>
                <Nav.Link >
                    <Link className='navbar-brand' to="/cart">
                        Orden de Reparacion
                    </Link>
                </Nav.Link>
                {/* <NavDropdown title="Remitos" id="collasible-nav-dropdown">
                    <NavDropdown.Item href="/users">Agregar Remitos</NavDropdown.Item>
                    <NavDropdown.Item href="#action/3.2">Listar Remitos</NavDropdown.Item>
                    
                </NavDropdown> */}
                </Nav>
                <Nav>
                <Nav.Link href="#deets">Jose Montivero</Nav.Link>
                <Nav.Link eventKey={2} href="#memes" onClick={this.handleLogout}>
                    
                        Cerrar Sesion
                    
                </Nav.Link>
                </Nav>
            </Navbar.Collapse>
            </Navbar>
            </div>
        )
    }
}

export default Sidebar;
